加圧でストレスなく測定できます<br><b>適応腕周</b>：17～32cm<br><b>医療機器認証番号</b>：220AGBZX00307000<br><b>医療機器分類</b>：管理医療機器<br><b>電源</b>：ACアダプタ/単3形乾電池 4本(別売)<br><b>寸法</b>：幅 179x高さ 211x奥行 246mm<br><b>質量</b>：約1600g(電池、専用ACアダプタ含まず)<br><b>付属品</b>：<br>　専用ACアダプタ<br>　取扱説明書(品質保証書付き)<br>　医療機器添付文書<br>　クイックガイド<br>　EMC技術文書<style type="text/css">
